import React from 'react';
import Navbar from './components/Navbar';
import { Routes, Route } from 'react-router-dom';
import './App.css';
import Home from './components/Pages/Home';

function App() {
  return (
    <>
    <Routes>
      <Navbar />

      <Route exact path="/" element={<Home />}/>

    </Routes>
    </>
  );
}

export default App;
